        {%- for group_name, group_values in models_grouping.items() %}
            {{group_name}}__final.{{ dim }} {%- if not loop.last -%},{% endif %}
            {%- if models_grouping | length == 1 %}
            , NULL
            {%- endif -%}
        {% endfor %}
