            {%- endfor -%}

            {%- for dim in dimensions %}
                {%- if loop.first and calendar_dimensions | length == 0 -%}
            {{ dim }}
                {%- elif not loop.first and calendar_dimensions | length == 0 -%}
            , {{ dim }}
                {%- else -%}
            , {{ dim }}
                {%- endif -%}
            {%- endfor -%}
        )
